import React from 'react';

class App extends React.Component {


  state = {
    title: '',
    body: ''
  };


  render () {

    // JSX 

    return(
      <div>
        <h2>Welcome to my App!</h2>
        <form>
          <div className="form-input">
            <input 
              type="text"
              name="title"
              value={this.state.title}
              onChange={2}
              placeholder="Title"
            />
          </div>
          <div className="form-input">
            <textarea
              name="body"
              cols="30"
              rows="10"
              value={this.state.value}
              onChange={2}
              placeholder="Body">
            </textarea>
          </div>
        </form>
      </div>
    );
  }
}

export default App;
